%sql
CREATE TABLE KDD_ATTACKTYPE (
    attack VARCHAR(4000),
    category VARCHAR(4000)
);

%script
BEGIN
DBMS_CLOUD.COPY_DATA(
    table_name =>'KDD_ATTACKTYPE',
    credential_name =>'CRED_KDD',
    --https://objectstorage.us-ashburn-1.oraclecloud.com/n/italysandbox/b/adwhimport/o/Attack_Type.txt
