%script
CALL DBMS_DATA_MINING.DROP_MODEL('KDD_CLASS_MODEL');
DROP TABLE  KDD_BUILD_SETTINGS;

%script
BEGIN
  EXECUTE IMMEDIATE 'CREATE TABLE KDD_BUILD_SETTINGS (SETTING_NAME VARCHAR2(30), SETTING_VALUE VARCHAR2(4000))';
  EXECUTE IMMEDIATE 'INSERT INTO KDD_BUILD_SETTINGS (SETTING_NAME, SETTING_VALUE) VALUES (''ALGO_NAME'',''ALGO_DECISION_TREE'')';
  EXECUTE IMMEDIATE 'CALL DBMS_DATA_MINING.CREATE_MODEL(''KDD_CLASS_MODEL'',''CLASSIFICATION'',''KDD_TRAIN'',''ID'',''TYPE'',''KDD_BUILD_SETTINGS'')';
END;

%script
DROP VIEW KDD_TEST_RESULT_view;
DROP TABLE KDD_TEST_RESULT;
DROP TABLE KDD_TEST_confusion_matrix;
DROP TABLE KDD_TEST_cost_matrix;
DROP TABLE kdd_confusion_matrix

%script


begin
 declare 
 v_accuracy NUMBER;
 begin
  DBMS_DATA_MINING.APPLY(
  model_name           => 'KDD_CLASS_MODEL',
  data_table_name      => 'KDD_TEST',
  case_id_column_name  => 'id',
  result_table_name    => 'KDD_TEST_RESULT');

  EXECUTE IMMEDIATE('CREATE VIEW KDD_TEST_RESULT_view as select id, type from KDD_TEST');


  DBMS_DATA_MINING.COMPUTE_CONFUSION_MATRIX(
      accuracy  => v_accuracy,
      apply_result_table_name   => 'KDD_TEST_RESULT',
      target_table_name            => 'KDD_TEST_RESULT_view',
      case_id_column_name          => 'id',
      target_column_name           => 'type',
      confusion_matrix_table_name  => 'KDD_TEST_confusion_matrix'
      );
  DBMS_OUTPUT.PUT_LINE('Accuracy of the model: ' || v_accuracy);
 end;
end;

%script

declare
type cls_array_type is table of varchar2(4000) index by binary_integer;
cls_array cls_array_type;
dml_str varchar2(400);
command_str varchar2(400);

BEGIN
dml_str :='';
command_str :='';

select distinct(category) bulk collect into cls_array from  kdd_attacktype order by category;
FOR i IN cls_array.first..cls_array.last-1 LOOP
  dml_str := dml_str || '''' || cls_array(i) || ''','; 
END LOOP;
dml_str := dml_str || '''' ||  cls_array(cls_array.last) || '''';

command_str := 'CREATE TABLE kdd_confusion_matrix as (SELECT * FROM KDD_TEST_confusion_matrix PIVOT ( SUM(value) FOR PREDICTED_TARGET_VALUE IN (' || dml_str  || ')))';
execute immediate (command_str);
END;
